const Container = styled.div`
  position: fixed;
  top: ${({ show }) => (show ? "0%" : "-100%")};
  transition: 0.2s cubic-bezier(0.075, 0.82, 0.165, 1);
  width: 100%;
  z-index: 99;

  ${Nav_Button} {
  }
`;

function Nav(show) {
  return (
    <Container {...show}>
      <Nav_Button>Sports</Nav_Button>
      <Nav_Button>Roster</Nav_Button>
      <Nav_Button>Contact</Nav_Button>
    </Container>
  );
}

export default Nav;
